import './App.css';
import bg from "./assets/bg-web.png"
import logo from "./assets/logo.png"

function App() {

  const styles = {
    text: {
      color: "#FFF"
    }
  }

  return (
    <div className="App" style={{backgroundImage: bg, backgroundSize: "cover", minHeight: "100vh" }}>
      <div className="header" style={{display: 'flex', flexDirection: "row"}}>
        <div className="Title" style={{display: 'flex', flexDirection: "row", alignItems: "center"}}>
          <h3 style={styles.text}>FlyF</h3>
          <h1 style={styles.text}>ai</h1>
          <h3 style={styles.text}>r</h3>
        </div>
        <img src={logo} />
      </div>
    </div>
  );
}

export default App;
